import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
  color: #00ff00;
`;

const Title = styled.h1`
  font-size: 2.5em;
  margin-bottom: 20px;
`;

const CodeList = styled.ul`
  list-style: none;
  padding: 0;
`;

const CodeItem = styled.li`
  background: #000;
  padding: 15px;
  margin: 10px 0;
  border-radius: 5px;
  width: 80%;
  max-width: 600px;
  box-shadow: 0 0 10px #00ff00;
`;

const Button = styled.button`
  margin-top: 20px;
  padding: 10px 20px;
  background: #00ff00;
  border: none;
  border-radius: 5px;
  color: #000;
  cursor: pointer;
  font-size: 1em;
`;

const SubmittedCodesPage = () => {
  // Aquí deberías tener lógica para obtener y mostrar los códigos enviados

  return (
    <Container>
      <Title>Submitted Codes</Title>
      <CodeList>
        <CodeItem>
          <strong>Title:</strong> Example Code 1
          <pre>
            <code>{`console.log("Hello, world!");`}</code>
          </pre>
        </CodeItem>
        {/* Más items de código aquí */}
      </CodeList>
      <Button onClick={() => window.location.href = '/blog'}>Back to Submit</Button>
    </Container>
  );
};

export default SubmittedCodesPage;
